import { blue } from "@mui/material/colors";
import { fontSize } from "@mui/system";
import { useState, useEffect } from "react";
import Navbar from "../templates/Navbar";
import React, { Component } from 'react';
import Buyer_Navbar from "../templates/Buyer_Navbar";
import axios from "axios";
import { useLocation } from "react-router-dom";
import Wallet from "./Wallet";

export default function Buyer_Home() {
  let location = useLocation();
  const [username, setName] = useState("");
  console.log(location.state)

  const onChnageUsername = (event) => {
    setName(event.target.value);
  }

  const newUser = {
    email: location.state,
    data: ""
  }
  axios.post("http://localhost:4000/user/buyer", newUser)
    .then((response) => {
      onChnageUsername(response.name);
    })
  return <div>

    <div><Buyer_Navbar></Buyer_Navbar></div>
    <Wallet />
    <h1> <center> Welcome {username}</center>  <center> Welcome {location.state}</center> </h1>
  </div>;
}
